import { CRow, CCol, CWidgetProgressIcon } from "@coreui/react";
import DWidget from "src/Components/UI/DWidget";
const Dashboard = () => {
  const widget = <DWidget
  value="12"
  text="Total Users"
  color="gradient-danger"
  icon="cil-people"
/>
  return (
  
    <>
      <CRow>
        <CCol sm="12" md="3">
          
        </CCol>
      </CRow>
    </>
  );
};
export default Dashboard;
